full_reasoning:
Step-by-step reasoning:
1. Key psychological mechanism: Responders likely judge an offer by comparing the received monetary share (split_self) to a fairness benchmark. This benchmark is computed from the participant’s token find relative to the total tokens (token_self/(token_self + token_opp)) scaled by the available combined earning.
2. Mechanism interaction: The ratio of the offered monetary share to the fairness benchmark provides a measure of relative fairness. If the offer meets the fairness benchmark, the utility is neutral aside from a baseline bias; offers above this benchmark yield a positive boost, whereas offers below yield a penalty.
3. Mathematical form: We capture the nonlinear sensitivity to deviations from fairness by raising the ratio (split_self divided by fairness benchmark) to a power given by a sensitivity parameter λ (lambda_param). Multiplying this by the fairness benchmark (r) ensures the penalty or bonus scales with the stake.
4. Learnable parameters:
  • Baseline bias (mu): captures intrinsic acceptance tendency.
  • Fairness sensitivity (lambda_param): governs how sharply utility changes as the offer deviates from the fairness benchmark.
5. Observable mapping: The fairness benchmark is calculated using combined_earning, token_self, and token_opp; split_self is the actual offer. Their interaction in the model captures variation among responders based on their pretask contribution and the resulting fairness perception.

The resulting formal model is as follows.

<MODEL>
Let r = combined_earning × (token_self/(token_self + token_opp))
Then, define:
  Utility U = mu + r × ((split_self/r)^(lambda_param) − 1)
</MODEL>

