<SUMMARY>
This model computes the utility of a responder’s offer by first determining a fairness benchmark defined as the expected monetary share based on token contributions. The offered share is compared to this benchmark via a ratio that is exponentiated with a fairness sensitivity parameter. The resulting scaled difference is added to a baseline bias, such that offers exceeding the benchmark yield positive utility and offers falling short incur a penalty.
</SUMMARY>
